import React from "react"
import MemeHeader from "./MemeHeader"
import MemeGenerator from "./MemeGenerator"


class MemeApp extends React.Component {
	render() {
		return (
			<div>
				<MemeHeader />
				<MemeGenerator />
			</div>
		)
		
	}
}


export default MemeApp
